import React, { useState } from 'react';
import homeCard from './OOS';
import { motion } from 'framer-motion';
import reactDom from 'react-dom';

let card={width: 100, height:100, backgroundColor:"#eeeeee", margin:10, borderRadius:12}

function App() {
  const {yes, no} = useState([])

 return (
    <div>
  <homeCard />
  <motion.h1 
  animate={{fontSize: 60, color: "#33333", x: 100, y: 10 }}
  transition={{ type:"spring", velocity: 120 }}  
   >
  OOS
  </motion.h1>



   <div>
   <div style={card} >列表 </div>
   <div style={card} >弹窗 </div>
   <div style={card} >界面跳转 </div>
   <div style={card} >选择类 </div>
   <div style={card} >其他类 </div>
   </div>
   <div style={{marginLeft: 120, marginTop:-550}}>
   <div style={card} >点击反馈 </div>
   <div style={card} >提升类 </div>
   <div style={card} >删除类 </div>
   <div style={card} >展开折叠类 </div>
   </div>


   </div>
  )
}

export default App;
